import React from 'react';
import { MenuList } from '../helpers/MenuList'
import MenuItem from '../components/MenuItem';
import '../styles/Menu.css'


const imgs = [
    { id: 1, src: "../assets./", caption: "Image 1" },
    { id: 2, src: "https://example.com/image2.jpg", caption: "Image 2" },
    { id: 3, src: "https://example.com/image3.jpg", caption: "Image 3" },
  ];




function Menu() {
    return (
        <div className='menu'>

            <h3 className='menuTitle'>Our Menu</h3>
            <div className='menuList'>{MenuList.map((menuItem, key)=>{
                return <MenuItem 
                key={key}
                image ={menuItem.image} 
                name={menuItem.name} 
                price={menuItem.price} />
            })}
            </div>
            <button>Add to Cart</button>
        </div>
    );
}

export default Menu;
